{
	uint32 _ptr_handle;
	NDR_CHECK(ndr_pull_uint32(ndr, &_ptr_handle));
	if (_ptr_handle) {
		NDR_ALLOC(ndr, r->out.handle);
	} else {
		r->out.handle = NULL;
	}
	if (r->out.handle) {
		NDR_CHECK(ndr_pull_policy_handle(ndr, r->out.handle));
	}
	NDR_CHECK(ndr_pull_NTSTATUS(ndr, &r->out.result));

	return NT_STATUS_OK;
}

